INSERT INTO `blogs` VALUES (1,'What is Onsyde ? - Part 1','cc69a434035778a1893f1fccf8ee9692.png','<p style=\"color: rgb(0, 0, 0); font-family: &quot;Source Sans Pro&quot;, sans-serif; font-size: 17px;\">Stones in your shoes, mud on your legs, muck on your shoes, sand on your feet and your mom screaming at you because you’ve come home all dirty - that was the sport life for most of us growing up in India.</p><p style=\"color: rgb(0, 0, 0); font-family: &quot;Source Sans Pro&quot;, sans-serif; font-size: 17px;\">That’s because we are used to playing in mud laden grounds when it comes to recreational games and even school or college level tournament due to the lack of proper sports infrastructure. This has been highlighted in this&nbsp;<a href=\"https://www.pwc.in/assets/pdfs/industries/entertainment-and-media/sports-infrastructure.pdf\" target=\"_blank\" style=\"color: rgb(0, 123, 255); transition: all 0.5s ease-in-out 0s;\">study</a>&nbsp;done by Assocham and PWC.</p><p style=\"color: rgb(0, 0, 0); font-family: &quot;Source Sans Pro&quot;, sans-serif; font-size: 17px;\"><img src=\"data:image/png;base64,\" data-filename=\"blog-content.png\" style=\"width: 1056.19px;\"><br></p>',0,0,'2020-02-27 10:52:19',NULL);
